import styled from "styled-components";

export const TheOriginalSixStyle = styled.div`
  position: absolute;
  .icons_box {
    height: 100vh;

    display: grid;
    grid-template-columns: 1fr 1fr 1fr;
    grid-template-rows: 5rem;
    justify-items: center;
  }

  .icons_img {
    width: 3rem;
    height: 3rem;

    /* padding: 0 1rem 0 1rem; */
  }
`;
